    false,nt"url": null,nt"notes": "This is a line data set for 'Railroads'
    of Louisiana extracted from 1997 TIGER/Line source data. Railroad Mainlines, Spurs,
    Yards, and specialized rail lines have Census Feature Class Codes (CFCC) of B01
    - B52, although in this data set, only B01, B03, B11, B12, B13, B21, B23, and B50
    codes are present. For a full discussion of the significance, use, technical details,
    and information contained in TIGER/Line data, the user is encouraged to consult
    the 1997 TIGER/Line Files Technical Documentation manual URL:../../metadata/tiger97c.pdf>.",nt"license_title":
